import React from "react";
import { BrowserRouter as Router,Routes,Route } from "react-router-dom";
import Navbar from "./project/navbar";

import Home from "./project/home";
function App () {
  return (
    <div>

        <Router>
        <Navbar /> 
        <Routes>
        <Route path="/" exact element={<Home/>} />
        </Routes>

        </Router>

    </div>



  )
}



export default App;
